import React from 'react';
import './GalleryItem.css';
import sky from '../img/sky.jpg';

const GalleryItem = () => {
  return (
    <div className='galery-item'>
      <img src={sky} alt="sky"/>
      <h2>Create account</h2>
      <p>Create your own personal space - personal or organizational. Add content, publish your thoughts&nbsp;and have fun!</p>
    </div>
  );
};

export default GalleryItem;
